import "../../CSS/imager_settings.css";
import { Container, Row, Col } from "react-bootstrap";
import React, { useState } from "react";
import CommonRow from "../../components/NavBar/common_row";
import LatLongTable from "../../components/Mission Planner/latLongTable";
import MapComponent from "../../components/Mission Planner/map";
import "../../components/Mission Planner/latLongTable.css";

function Imager_Settings() {
  const [data, setData] = useState([
    {
      id: 1,
      command: "",
      p1: "0",
      p2: "0",
      p3: "0",
      p4: "0",
      latitude: "",
      longitude: "",
      alt: "",
      frame: "",
      grad: "",
      angle: "",
      dist: "",
      az: "",
    },
  ]);

  const [markerPositions, setMarkerPositions] = useState([]);

  const onMapClick = (event) => {
    const lat = event.latLng.lat();
    const lng = event.latLng.lng();

    setData((oldData) => {
      const newData = [...oldData];
      const firstRow = newData[0];

      // If the first row is empty, populate it with the coordinates of the marker
      if (firstRow.latitude === "" && firstRow.longitude === "") {
        firstRow.latitude = lat;
        firstRow.longitude = lng;
      }
      // If the first row is not empty, create a new row
      else {
        newData.push({
          id: newData.length + 1,
          command: "",
          p1: "",
          p2: "",
          p3: "",
          p4: "",
          latitude: lat,
          longitude: lng,
          alt: "",
          frame: "",
        });
      }

      return newData;
    });

    setMarkerPositions((oldMarkerPositions) => [
      ...oldMarkerPositions,
      { lat, lng },
    ]);
  };

  return (
    <Container fluid>
      <div>
        <CommonRow />
      </div>
      <div></div>
      <Row>
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <div className="sensor-measurement-settings">
            <div className="sensor-measurement-settings-title">
              FieldDock Mission Planner
            </div>
          </div>
        </Col>
      </Row>
      <Row
        style={{
          justifyContent: "center",
          alignItems: "center",
          display: "flex",
        }}
      >
        <div
          style={{
            display: "flex",
            width: "94%",
            marginBottom: "30px",
          }}
        >
          <Col xs={12} sm={6} md={6} lg={8} xl={8} xxl={8}>
            <div
              style={{
                height: "815px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                marginRight: "15px",
                border: "1px solid #797979",
                backgroundColor: "transparent",
              }}
            >
              {/* <MapComponent
                onMapClick={onMapClick}
                markerPositions={markerPositions}
              /> */}
            </div>
          </Col>
          <Col xs={12} sm={6} md={6} lg={4} xl={4} xxl={4}>
            <div
              style={{
                height: "700px",
                justifyContent: "center",
                alignItems: "center",
                marginLeft: "15px",
                border: "1px solid #797979",
                backgroundColor: "transparent",
                overflow: "auto", // This will add a scrollbar if the table exceeds the div's size
              }}
            >
              <LatLongTable data={data} setData={setData} />
            </div>
            <div //container for both home location and buttons box
              style={{
                display: "flex",
                justifyContent: "space-between",
                height: "100px",
                marginLeft: "15px",
                marginTop: "15px",
                backgroundColor: "transparent",
              }}
            >
              <div //home location box
                style={{
                  width: "33%",
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                  backgroundColor: "transparent",
                  border: "1px solid #797979",
                }}
              >
                {/* Add the content of the small box here */}
              </div>
              <div
                style={{
                  width: "65%",
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                  border: "1px solid #797979",
                  backgroundColor: "transparent",
                }}
              >
                <button
                  style={{
                    border: "1px solid orange",
                    color: "#e0e0e0",
                    width: "20%",
                    marginRight: "10px",
                    backgroundColor: "transparent",
                    borderRadius: "5px",
                  }}
                  onMouseOver={() => {
                    this.style.borderColor = "#e0e0e0";
                    this.style.color = "orange";
                  }}
                  onMouseOut={() => {
                    this.style.borderColor = "orange";
                    this.style.color = "#e0e0e0";
                  }}
                >
                  Save
                </button>

                <button
                  style={{
                    border: "1px solid orange",
                    color: "#e0e0e0",
                    width: "20%",
                    marginRight: "10px",
                    backgroundColor: "transparent",
                    borderRadius: "5px",
                  }}
                  onMouseOver={() => {
                    this.style.borderColor = "#e0e0e0";
                    this.style.color = "orange";
                  }}
                  onMouseOut={() => {
                    this.style.borderColor = "orange";
                    this.style.color = "#e0e0e0";
                  }}
                >
                  Load
                </button>

                <button
                  style={{
                    border: "1px solid orange",
                    color: "#e0e0e0",
                    width: "40%",
                    backgroundColor: "transparent",
                    borderRadius: "5px",
                    height: "35px",
                  }}
                  onMouseOver={() => {
                    this.style.borderColor = "#e0e0e0";
                    this.style.color = "orange";
                  }}
                  onMouseOut={() => {
                    this.style.borderColor = "orange";
                    this.style.color = "#e0e0e0";
                  }}
                >
                  Launch
                </button>
              </div>
            </div>
          </Col>
        </div>
      </Row>

      {/* ------------------------------------------------- row 1 END ----------------------------- */}
    </Container>
  );
}

export default Imager_Settings;
